import Theme from './Theme'
import Photo from './Photo'
import amplify from './images/amplify.png'

const BlogArticle = () => {
return(
    <div id='post'>
    <Theme
      titleBoxStyle='post-title-box'
      titleStyle='post-title'
      titleValue='BLOG POST'
    />
    <div id='article'>
        <h2 id='article_title'>Create a full-stack web application using AWS Amplify</h2>
        <Photo src={amplify} name='amplify and react' credit='https://medium.com/better-programming/build-a-react-app-with-authentication-using-aws-amplify-49db1dfdc290'/>
    </div>

  </div>
);
}


export default BlogArticle;
